","keccak256":"0x1562cd9922fbf739edfb979f506809e2743789cbde3177515542161c3d04b164"},"contracts/Distributor.sol":{"content":"pragma solidity >=0.6.7 <0.9.0;

//SPDX-License-Identifier: MIT

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Distributor {
    // utilize safemath for solidity <0.8.0
    using SafeMath for uint256;

    // validate 1-1 relationship between users and shares
    modifier accurateUserSharesRatio(
        address[] memory users,
        uint256[] memory shares
    ) {
        require(users.length == shares.length, "Incorrect distribution ratio");
        _;
    }

    // check provided balance >= total number of shares to distribute
    modifier hasEnoughBalance(uint256[] memory shares, uint256 balance) {
        uint256 totalShares;
        for (uint256 i = 0; i < shares.length; i++) {
            totalShares = totalShares.add(shares[i]);
        }
        // make sure specified balance is greater than totalShares specified
        require(balance >= totalShares, "Not enough eth for distribution");
        _;
    }

    // escrow management functions
    // share ETH from contract account balance
    function _shareETH(address[] memory users, uint256[] memory shares)
        internal
        accurateUserSharesRatio(users, shares)
        hasEnoughBalance(shares, address(this).balance)
    {
        _distribute(users, shares, address(0), address(0));
    }

    // share ERC-20 token from contract balance
    function _shareToken(
        address[] memory users,
        uint256[] memory shares,
        IERC20 token
    )
        internal
        accurateUserSharesRatio(users, shares)
        hasEnoughBalance(shares, token.balanceOf(address(this)))
    {
        _distribute(users, shares, address(token), address(this));
    }

    // user balance management functions
    // share ETH from amount payed by user
    function _sharePayedETH(address[] memory users, uint256[] memory shares)
        internal
        accurateUserSharesRatio(users, shares)
        hasEnoughBalance(shares, msg.value)
    {
        _distribute(users, shares, address(0), address(0));
    }

    // share tokens from approved spender account
    function _sharePayedToken(
        address[] memory users,
        uint256[] memory shares,
        IERC20 token,
        address spender
    )
        internal
        accurateUserSharesRatio(users, shares)
        hasEnoughBalance(shares, token.balanceOf(spender))
    {
        require(
            spender == msg.sender,
            "You can't distribute someone else's token balance"
        );
        require(
            spender != address(this),
            "Use other shareToken method for contract token distribution"
        );

        _distribute(users, shares, address(token), spender);
    }

    function _distribute(
        address[] memory users,
        uint256[] memory shares,
        address token,
        address spender
    ) internal {
        bool isToken = token != address(0) && spender != address(0);
        bool spenderIsContract = address(this) == spender;

        for (uint256 i = 0; i < users.length; i++) {
            // make sure user is not genesis account and shares is greater than 0
            if (users[i] != address(0) && shares[i] > 0) {
                if (isToken) {
                    // send ERC20 token
                    if (spenderIsContract) {
                        // from contract if spender is contract
                        IERC20(token).transfer(users[i], shares[i]);
                    } else {
                        // from spender if spender is not contract
                        IERC20(token).transferFrom(
                            spender,
                            users[i],
                            shares[i]
                        );
                    }
                } else {
                    // transfer ETH otherwise (we do not care if the transfer is successful 
                    // or not, as this would block all other transfers)
                    users[i].call{value: shares[i]}("");
                }
            }
        }
    }
}
","keccak256":"0x6121905a0833b4ed8d30f3a277f8ff72ae49a8f836711ba0cb05f7ea5ab34bdf"},"contracts/QuadraticDiplomacyContract.sol":{"content":"pragma solidity >=0.6.7 <0.9.0;
pragma experimental ABIEncoderV2;
//SPDX-License-Identifier: MIT
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./Distributor.sol";

contract QuadraticDiplomacyContract is Distributor, AccessControl {
    event Vote(address votingAddress, address wallet, uint256 amount);
    event AddMember(address admin, address wallet);
    event NewElection(uint256 blockNumber);

    bytes32 public constant VOTER_ROLE = keccak256("VOTER_ROLE");

    mapping(address => uint256) public votes;

    uint256 public currentElectionStartBlock;

    constructor() public {
        _setupRole(
            DEFAULT_ADMIN_ROLE,
            address(0x6F5C5E1997269070d7899dD2a6405B7F91362199)
        );
        _setupRole(
            DEFAULT_ADMIN_ROLE,
            address(0x6F5C5E1997269070d7899dD2a6405B7F91362199)
        );
        currentElectionStartBlock = block.number;
    }

    modifier onlyAdmin() {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "NOT ADMIN");
        _;
    }

    modifier canVote() {
        require(
            hasRole(VOTER_ROLE, msg.sender),
            "You don't have the permission to vote."
        );
        _;
    }

    modifier startNewElectionAfter(address tokenAddress) {
        _;

        // remove all voter roles
        // an alternative (and less gas heavy?) way to do this would be to change the VOTER_ROLE to keccak256(abi.encodePacked(block.number));

        uint256 memberCount = getRoleMemberCount(VOTER_ROLE);
        for (uint256 i = 0; i < memberCount; i++) {
            revokeRole(VOTER_ROLE, getRoleMember(VOTER_ROLE, 0));
        }

        currentElectionStartBlock = block.number;
        emit NewElection(block.number);
    }

    function vote(address wallet, uint256 amount) private {
        require(votes[msg.sender] >= amount, "Not enough votes left");
        votes[msg.sender] -= amount;
        emit Vote(msg.sender, wallet, amount);
    }

    function voteMultiple(address[] memory wallets, uint256[] memory amounts)
        public
        canVote
    {
        require(wallets.length == amounts.length, "Wrong size");

        for (uint256 i = 0; i < wallets.length; i++) {
            vote(wallets[i], amounts[i]);
        }
    }

    function admin(address wallet, bool value) public onlyAdmin {
        if (value) {
            grantRole(DEFAULT_ADMIN_ROLE, wallet);
        } else {
            revokeRole(DEFAULT_ADMIN_ROLE, wallet);
        }
    }

    function giveVotes(address wallet, uint256 amount) public onlyAdmin {
        votes[wallet] += amount;
    }

    function addSingleMemberWithVotes(address wallet, uint256 voteAmount)
        public
        onlyAdmin
    {
        votes[wallet] = voteAmount;
        grantRole(VOTER_ROLE, wallet);
        emit AddMember(msg.sender, wallet);
    }

    function addMembersWithVotes(
        address[] memory wallets,
        uint256 voteAllocation
    ) public onlyAdmin {
        for (uint256 i = 0; i < wallets.length; i++) {
            addSingleMemberWithVotes(wallets[i], voteAllocation);
        }
    }

    // expose distributor functions
    function shareETH(address[] memory users, uint256[] memory shares)
        public
        onlyAdmin
        startNewElectionAfter(address(0))
    {
        _shareETH(users, shares);
    }

    function sharePayedETH(address[] memory users, uint256[] memory shares)
        public
        payable
        onlyAdmin
        startNewElectionAfter(address(0))
    {
        // makes sure msg.value has some eth in it
        _sharePayedETH(users, shares);
    }

    function shareToken(
        address[] memory users,
        uint256[] memory shares,
        IERC20 token
    ) public onlyAdmin startNewElectionAfter(address(token)) {
        _shareToken(users, shares, token);
    }

    function sharePayedToken(
        address[] memory users,
        uint256[] memory shares,
        IERC20 token,
        address spender
    ) public onlyAdmin startNewElectionAfter(address(token)) {
        _sharePayedToken(users, shares, token, spender);
    }

    function deposit() public payable {}

    // payable fallback function
    receive() external payable {}

    fallback() external payable {}
}
